import { useLanguage } from "../context/LanguageContext";

export default function Home() {
  const { language } = useLanguage();

  return (
    <main className="min-h-screen flex flex-col justify-center items-center bg-white text-gray-800 dark:bg-gray-900 dark:text-gray-100 p-6">
      <h1 className="text-5xl font-bold mb-4">Youngjee Park</h1>
      <p className="text-xl text-center max-w-xl">
        {language === "en"
          ? "Passionate Developer & Creative Thinker"
          : "열정적인 개발자, 창의적인 사고를 가진 사람"}
      </p>
    </main>
  );
}
